                "script": "on click\n   -- add a card for later\n   add card to current stack\n   -- hide the toolbox\n   tell window \"Toolbox\" of current stack to set \"hide\" to true \n   put 0 into global fadeCounter\n   startTheMusic\n   -- steps at 1s\n   set \"stepTime\" to 1000\n   set \"stepping\" to true\nend click\n\non mouseEnter\n  tell window \"Toolbox\" of current stack to set \"hide\" to true \n  -- just make sure that everything is sized right\n  set \"top\" to 0\n  set \"left\" to 0\n\n  set \"width\" to \"fill\"\n  set \"height\" to \"fill\"\n  -- make sure we can see everything\n  set \"transparency\" to 0\n  tell first image of current card to set \"transparency\" to 1\n  tell first image of current card to set \"width\" to \"fill\"\n  tell first image of current card to set \"height\" to \"fill\"\nend mouseEnter\n\non step\n  set \"name\" to (fadeCounter / 10)\n  set \"transparency\" to (1 - fadeCounter/10) in first image of current card\n  put (fadeCounter + 1) into global fadeCounter\n  if fadeCounter == 11 then stopIt\nend step\n\non startTheMusic\n   tell audio \"USSR\" of current card to set \"src\" to \"https://archive.org/download/01NationalAnthemOfTheUSSR/01_-_National_Anthem_of_the_USSR.mp3\"\n   tell audio \"USSR\" of current card to set \"play\" to true \nend startTheMusic\n\non stopIt\n   set \"stepping\" to false\n   tell audio \"USSR\" of current card to set \"play\" to false\n   tell window \"Toolbox\" of current stack to set \"hide\" to false\n   go to next card\nend stopIt\n",
